import Parse from "parse/dist/parse.min.js";

// used in auth register component
export const checkUser = (newUser) => {
  const user = new Parse.User();

  user.set("username", newUser.email);
  user.set("password", newUser.password);

  console.log("User: ", user);
  return user
    .logIn()
    .then((newLoginSuccess) => {
      console.log("yes, it worked");
      console.log("LogService says: " + user.authenticated());
      sessionStorage.setItem("isAuth", user.authenticated());
      var flag = window.sessionStorage.getItem("isAuth");
      console.log("Flag here, sitting in logService Flag: " + flag);
      console.log("Flag here, sitting in logService TYPEEEE: " + typeof flag);

      return newLoginSuccess;
    })
    .catch((error) => {
      alert(`Error: ${error.message}`);
      console.log("LogService says: " + user.authenticated());
      sessionStorage.setItem("isAuth", user.authenticated());
      var flag = window.sessionStorage.getItem("isAuth");
      console.log("Flag here, sitting in logService Flag: " + flag);
      console.log("Flag here, sitting in logService TYPEEEE: " + typeof flag);
    });
};
